window.bookSummaryJSON = "<p>Never in my 30 years did I think my new normal would be a gig as a soul collector's assistant - slave really - where I help stockpile souls from the miserable mortals who sell them to him. The demon thinks he can control me, but I plan on doing things differently...my way. But we all know it's never that easy or that simple, especially in my life.</p> <p>Surprisingly, things get off to a good start. Who am I kidding? The job doesn't pan out to be what I first thought. It's worse. Way worse. And before I know it, I'm in hot water with no easy way out.</p> <p>If that isn't bad enough, the soul collector is hiding something from me that could make or break the deal I made with him. Something, if found out, that could change everything....</p> <p>It's time to yank up my big girl panties, chuck down some wine, and do things my way. If it doesn't kill me first.</p>"; 
